export default function App() {
  const [animations, setAnimation] = React.useState({
    name: false,
    button: true,
    text: true,
  });

  const [topBar, setTopBar] = React.useState({
    main: false,
    buttons: false,
    divider: false,
  });

  const [page, setPage] = React.useState(false);

  const [activeStep, setActiveStep] = React.useState(0);

  const { height, width } = useViewportSize();

  const { scrollY, scrollYProgress } = useScroll();

  useMotionValueEvent(scrollY, "change", (latest) => {
    setActiveStep(Math.round((latest + 0.5) / height));
  });

  console.log(scrollYProgress);

  const smallScreen = useMediaQuery("(max-device-width : 480px)");

  const [scroll, scrollTo] = useWindowScroll();
  console.log(scroll);

  React.useEffect(() => {
    setAnimation({
      ...animations,
      text: false,
    });
    animate(
      ".name--text",
      { opacity: [0, 1] },
      { type: "spring", duration: 2, delay: 1 }
    );
    animate(
      ".whos-this--button",
      { opacity: [0, 1] },
      { type: "spring", duration: 2, delay: 2 }
    );
  }, []);
  return (
    <Container>
      <Section>
        <Box>
          <Box
            id="topbar"
            sx={{
              flex: 1,
              p: 2,
              width: "100%",
              position: "fixed",
              left: 0,
              top: topBar.buttons ? "0vh" : "28vh",
              transition: "top .5s ease",
              transitionDelay: "1s",
              backdropFilter: topBar.main ? "blur(2.5px)" : "none",
              ml: -2,
              zIndex: "1",
              backdropFilter: "blur(1px)",
            }}
          >
            <Container
              sx={{
                display: topBar.buttons ? "flex" : "block",
                justifyContent: "space-between",
                alignItems: "center",
                textAlign: "center",
              }}
            >
              <Box
                className="topbar--button"
                sx={{
                  width: !smallScreen ? "70px " : "auto",
                  textAlign: "start",
                  pr: smallScreen && 2,
                  // ml: 2,
                  display: topBar.buttons ? "inline" : "none",
                  opacity: "0",
                }}
              >
                <SVG color="white" />
              </Box>
              <Typography
                className="custom-text name--text"
                sx={{
                  display: "flex",
                  alignItems: "center",
                  justifyContent: smallScreen ? "flex-start" : "center",
                  height: "100%",
                  opacity: "0",
                  transition: "font-size .5s, height .75s, opacity 5s",
                  fontSize: smallScreen ? "4rem" : "6rem",
                  flexGrow: 1,
                }}
              >
                Pradyut Das
              </Typography>
              <Typography
                type="button"
                className="whos-this--button"
                sx={{
                  fontSize: "1.75rem",
                  opacity: 0,
                  textShadow: "0px 0px 20px #32cd32",
                }}
                onClick={() => {
                  animate(
                    ".name--text",
                    { fontSize: ["2rem", "1.5rem"] },
                    { type: "linear", duration: 1 }
                  );
                  setTopBar({ ...topBar, buttons: true });
                  animate(
                    ".topbar--button",
                    { opacity: ["0", "1"] },
                    { type: "linear", duration: 2, delay: 1 }
                  );
                  // animate(
                  //   ".whos-this--button",
                  //   { opacity: [1, 0] },
                  //   { type: "spring", duration: 2, delay: 0 }
                  // );
                  animate(
                    ".whos-this--button",
                    { display: "none" },
                    { type: "spring", duration: 2, delay: 0 }
                  );
                  setTimeout(() => {
                    setPage(true);
                  }, 1500);
                }}
              >
                who's this?
              </Typography>
              <Box
                className="topbar--button"
                sx={{
                  width: "70px",
                  textAlign: "end",
                  opacity: "0",
                  display: topBar.buttons ? "inline" : "none",
                }}
              >
                <FormControlLabel
                  control={<MaterialUISwitch defaultChecked />}
                  aria-label="Theme switch"
                  sx={{
                    opacity: topBar ? "1" : "0",
                    transition: "opacity .5s",
                    transitionDelay: "1s",
                    m: 0,
                  }}
                />
              </Box>
            </Container>
          </Box>
          {/* <Divider className="topbar--divider" sx={{ border: 1, opa city: 0 }} /> */}
        </Box>
        {page && (
          <Grid container sx={{ pt: "4rem", height: "100%" }}>
            <Grid item xs={0} sm={0} md={3} sx={{}}></Grid>
            <Grid item xs={12} sm={8} md={6} sx={{ p: 2, mt: "-5rem" }}>
              {/* <Box className="terminal--container"> */}
              {steps.map((step, index) => (
                <Box
                  key={step.heading}
                  sx={{
                    height: height,
                    display: smallScreen ? "block" : "flex",
                    flexDirection: "column",
                    justifyContent: "center",
                  }}
                >
                  <Typography
                    className="terminal--text"
                    sx={{ color: "white", pt: smallScreen && "6rem" }}
                    fontWeight="800"
                    variant="h5"
                  >
                    {step.heading}
                  </Typography>
                  <Typography className="terminal--text">
                    {activeStep == index && (
                      <Typewriter
                        onInit={(typewriter) => {
                          typewriter.typeString(step.content).start();
                        }}
                      />
                    )}
                  </Typography>
                </Box>
              ))}

              {/* </Box> */}
            </Grid>
            <Grid
              item
              xs={12}
              sm={4}
              md={3}
              sx={{
                position: smallScreen ? "sticky" : "fixed",
                bottom: "0",
                width: "100%",
                display: "flex",
                height: smallScreen && "max-content",
                justifyContent: smallScreen && "flex-end",
                backdropFilter: "blur(2.5px)",
                height: !smallScreen && "100vh",
                alignItems: !smallScreen && "center",
                marginTop: !smallScreen && "-4rem",
                right: !smallScreen && 0,
              }}
            >
              <Box
                sx={{
                  position: "sticky",
                  top: "5rem",
                  width: "max-content",
                  display: "inline-block",
                  pb: 2,
                }}
              >
                <Box sx={{ display: "flex" }}>
                  <Timeline
                    sx={{
                      "& > li::before": { display: "none" },
                    }}
                    position="left"
                  >
                    {steps.map((step, index) => (
                      <TimelineItem
                        sx={{ minHeight: smallScreen ? "32px" : null }}
                        onClick={() => {
                          scrollTo({ y: height * index });
                        }}
                      >
                        <TimelineSeparator>
                          <TimelineDot
                            variant="outlined"
                            sx={{
                              borderColor: step.color,
                              background:
                                index == activeStep
                                  ? step.color
                                  : "transparent",
                              transition: "background .5s ease",
                            }}
                          />
                          {!smallScreen && index + 1 != steps.length ? (
                            <TimelineConnector />
                          ) : null}
                        </TimelineSeparator>
                        <TimelineContent
                          sx={{
                            color: `${step.color}!important`,
                            fontWeight: "700",
                            textShadow:
                              index == activeStep
                                ? `0 2px 20px ${step.color}`
                                : "0 0 BLACK",
                            transition: "text-shadow .25s",
                            cursor: "pointer",
                            "&:hover": {
                              textShadow: "0 2px 20px white",
                            },
                          }}
                        >
                          {step.heading}
                        </TimelineContent>
                      </TimelineItem>
                    ))}
                  </Timeline>
                  <Box
                    component={"span"}
                    sx={{
                      color: `${steps[activeStep].color}!important`,
                      paddingBlock: "12px",
                      position: "relative",
                      marginTop: "1px",
                      top: smallScreen
                        ? `calc(36px * ${activeStep})`
                        : `calc(70px * ${activeStep} )`,
                      height: "min-content",
                      transition: "top .5s ease-in, color 1s ease-out",
                      left: "-1rem",
                      fontWeight: 900,
                    }}
                  >
                    {"<"}
                  </Box>
                </Box>
              </Box>
            </Grid>
          </Grid>
        )}
      </Section>
    </Container>
  );
}

